import React from 'react';
import slide from './../Images/slide.png';
import backup from './../Images/BackupSlide.png'


function AboutUs(){

    return(
        <div className="Home">
            <img src={slide} />;
            <br></br>
            <img src={backup} />

        </div>
    );
}

export default AboutUs;
